import React from 'react';
import './header.scss';

export default function Header() {
    return (
        <div className="header d-flex justify-content-center">
            <div className="d-flex">
                <div>About Me</div>
                <div>Projects</div>
            </div>
            <img src="./catheadlogo.png" alt="headlogo" className="header-logo"/>
            <div className="d-flex">
                <div>Games</div>
                <div>Contact Me</div>
            </div>
        </div>
    );
}
